import React from 'react';
import logo from './logo.svg';
import { VictoryChart, VictoryVoronoiContainer, VictoryGroup, VictoryTooltip, VictoryLine, VictoryScatter, VictoryAxis, VictoryTheme } from 'victory';
import './App.css';

const data = [
  { x: 0, y: 0 },
  { x: 1, y: 0 },
  { x: 2, y: 0 },
  { x: 2, y: 1 },
  { x: 2, y: 2 },
  { x: 2, y: 3 },
  { x: 1, y: 3 }
];

const strokeDasharray = "10, 5";

class App extends React.Component {
  render() {
    return (
      <VictoryChart height={400} width={400} containerComponent={<VictoryVoronoiContainer/>}>
        <VictoryAxis crossAxis
          width={400}
          height={400}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetY={200}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 5},
            tickLabels: {fontSize: 5, padding: 2}
          }}
        />
        <VictoryAxis dependentAxis crossAxis
          width={400}
          height={400}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetX={200}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 5},
            tickLabels: {fontSize: 5, padding: 2}
          }}
        />
        <VictoryLine
          style={{
          data: { stroke: "#c43a31" },
          parent: { border: "1px solid #ccc"}
          }}
          data={[
            { x: 0, y: 0 },
            { x: 1, y: 0 },
          ]}
        />

      </VictoryChart>
    );
  }
}

export default App;


